import * as React from "react";
import data from "../mock-data.json";

export const Table = () => {
  const [workouts, setWorkout] = React.useState(data);

  const renderTableData = () => {
    return workouts.forEach((element) => {
      element.exercises.forEach(({ exerciseId, exerciseName, rep, sets }) => {
        console.log("EXERCISE", element);
        return (
          <tr key={exerciseId}>
            <td>{exerciseId}</td>
            <td>{exerciseName}</td>
            <td>{rep}</td>
            <td>{sets}</td>
          </tr>
        );
      });
    });
  };

