  //         <td>{exerciseName}</td>
  //         <td>{rep}</td>
  //         <td>{sets}</td>
  //       </tr>
  //     );
  //   });
  // };

  return (
    <div className="table-container">
      <table id="workouts" className="center">
        <thead></thead>
        <tbody>{renderTableData()}</tbody>
      </table>
    </div>
  );
};

